import React from 'react';

const style={
    div:{
        position:'relative',
        display:'flex'
    },
    line:{
        zIndex:'2',
        position:'absolute',
        borderLeft:"6px solid #0688FA",
        height:'100%',
    },
    icon:{
        position:'absolute',
        zIndex:3
    }      
}
export default function TimelineCard({iconURL,year,content}){
    return(
        <div className="row">

            <p  className="col-sm-1">{year} </p>
            <div>
            <div style={style.div} className='m-0 p-0 h-100'>

                    <img style={style.icon}className='u-icon u-icon--md' src={iconURL} alt='icon' />
                    <span style={style.line}>{" "}</span>

            </div>
            </div>
            <p>
                {content}
            </p>
        </div>
    )
}
